import request from '@/utils/request'; // 查询仪表分类

export function queryKindList(query) {
  return request({
    url: "/ems/meterKind/kindList",
    method: 'get',
    params: query
  });
} // 新增

export function createKind(data) {
  return request({
    url: "/ems/meterKind/kindSave",
    method: 'post',
    data: data
  });
} // 更新

export function updateKind(code, data) {
  return request({
    url: "/ems/meterKind/kindUpdate/".concat(code),
    method: 'patch',
    data: data
  });
} // 删除

export function deleteKind(data) {
  return request({
    url: "/ems/meterKind/kindDelete",
    method: 'delete',
    data: data
  });
}
